import PersonalInfoStyling from "./css/PersonalInfo.module.css";

function PersonalInfo(props) {
  return (
    <div className={PersonalInfoStyling.container}>
      <p className={PersonalInfoStyling.sectionTitle}>Personal Information</p>
      <form>
        <div className={PersonalInfoStyling.inputContainer}>
          <input
            name="firstName"
            type="text"
            defaultValue=""
            placeholder="First Name"
            onChange={props.handleChange}
            className={PersonalInfoStyling.inputStyling}
          />
          <input
            name="lastName"
            type="text"
            defaultValue=""
            placeholder="Last Name"
            onChange={props.handleChange}
            className={PersonalInfoStyling.inputStyling}
          />
          <input
            name="email"
            type="email"
            pattern="[a-z0-9._%+-]+@[a-z0-9.-]+\.[a-z]{2,4}$"
            defaultValue=""
            placeholder="email"
            required
            onChange={props.handleChange}
            className={PersonalInfoStyling.inputStyling}
          />
          <div>save</div>
        </div>
      </form>
    </div>
  );
}

export default PersonalInfo;
